function [fitresult, gof] = createFit(pos_x, pos_y)
%CREATEFIT(POS_X,POS_Y)
%  Create a fit.
%
%  Data for 'untitled fit 1' fit:
%      X Input : pos_x
%      Y Output: pos_y
%  Output:
%      fitresult : a fit object representing the fit.
