%% Fit: 'untitled fit 1'.
[xData, yData] = prepareCurveData( pos_x, pos_y );

% Set up fittype and options.
ft = fittype( 'gauss4' );
opts = fitoptions( 'Method', 'NonlinearLeastSquares' );
opts.Display = 'Off';
opts.Lower = [0 0.62 0 0 0.65 0 0 0.68 0 0 0.71 0];
opts.StartPoint = [118 0.6295 0.00355114114105729 93.2066503189443 0.6235 0.00478573278068932 40.8033798606778 0.6385 0.00619169176517932 27.6425531687581 0.6175 0.0140319358008863];
