% Fit model to data.
[fitresult, gof] = fit( xData, yData, ft, opts );

% Plot fit with data.
figure( 'Name', 'untitled fit 1' );
h = plot( fitresult, xData, yData );
legend( h, 'pos_y vs. pos_x', 'untitled fit 1', 'Location', 'NorthEast' );
% Label axes
xlabel pos_x
ylabel pos_y
grid on


